import React, {Component} from 'react';

import { BrowserRouter, Route, Link } from "react-router-dom";
import { Button } from 'reactstrap';
import { ListGroup, ListGroupItem, Badge } from 'reactstrap';

import DayIcon from '../images/day_icon.png';
import ClockIcon from '../images/clock_icon.png';

class TopHeader extends Component {


    render(){
        return(
            <div className="top_header">
                <ListGroup>
                    <ListGroupItem className="justify-content-between" tag="a" href="#">
                        <div class="icon bg-white text-center rounded-circle mr-3">
                            <img src={DayIcon} alt="Day Icon"/>
                        </div>
                        <div class="text_content text-white">
                            <span class="d-block">Day:</span>Monday
                        </div>
                    </ListGroupItem>
                    <ListGroupItem className="justify-content-between" tag="a" href="#">
                        <div class="icon bg-white text-center rounded-circle mr-3">
                            <img src={ClockIcon} alt="Day Icon"/>
                        </div>
                        <div class="text_content text-white">
                            <span class="d-block">Date & Time:</span>19.02.2021 / 8:30 AM
                        </div>
                    </ListGroupItem>
                    <ListGroupItem className="justify-content-between" tag="a" href="#">
                        Dapibus ac facilisis in <Badge pill>2</Badge>
                    </ListGroupItem>
                   
                </ListGroup>

                <p>hjhjhhjhjh</p>

                <BrowserRouter>
                    <Link to="#"> home</Link>
                </BrowserRouter>
                <Button color="danger">Danger!</Button>


                



            </div>
        );

        
    }

}
export default  TopHeader;
